CREATE DEFINER=`pms`@`localhost` PROCEDURE `total_amount` (IN `medid` VARCHAR(10))  READS SQL DATA
    DETERMINISTIC
BEGIN
DECLARE tab INTEGER DEFAULT 0;
DECLARE quan INTEGER DEFAULT 0;
DECLARE price INTEGER DEFAULT 0;

DECLARE tabprice CURSOR FOR SELECT medicine.tabprice FROM medicine WHERE medicine.medid = medid;
DECLARE quantity CURSOR FOR SELECT bill.quantity FROM bill WHERE bill.medid = medid;
 OPEN tabprice;
 FETCH tabprice INTO tab ;
 OPEN quantity;
 FETCH quantity INTO quan ;
  SET price = (tab*quan);
 UPDATE bill SET bill.price = price WHERE bill.medid = medid;
  CLOSE tabprice;
  CLOSE quantity;
  END$$

DELIMITER ;

